  header = new HttpHeaders().set('X-Api-Key', 'CLVkeSLFEU5XfcID/9dlOA==LNSpyNErpECEjn79')
  getFact() {
    console.log(this.http.get('https://api.api-ninjas.com/v1/facts?limit=1', { headers: this.header }));

